package com.koo.generator.utils;

import java.awt.image.BufferedImage;
import java.util.ArrayList;
import java.util.HashMap;
import java.util.List;
import java.util.Map;

/**
 * @author gu.wq
 * @version 1.0
 * @type IDCardFront
 * @desc
 * @date 2024/3/21 14:32
 */
public class IDCardFront {

    private static String base64Front = "";

    /**
     * 身份证正面
     *
     * @param args
     */
    public static void main(String[] args) {
        IdCardUtil tt = new IdCardUtil();
        Map<String, String> result = new HashMap<>();
        tt.defineIdno(result, "441424199512086036");
        String name = "雷军";
        String address = "新疆XX县XXXX镇XX社区XXX路XXXX苑一期XX号楼X单元XXX室";
        String fileName = "E:\\idcard\\" + name + "Front8.jpg"; //生成文件名
//        BufferedImage d = tt.base64ToBufferedImage(base64Front);
        BufferedImage d = tt.loadImageUrl(ClassLoader.getSystemResource("idz_nan1.jpg"));
        //往图片上写文字
        tt.writeImageLocal(fileName, tt.modifyImage(d, name, 95, 48, 0)); //姓名
        tt.writeImageLocal(fileName, tt.modifyImage(d, result.get("sex"), 95, 95, 0)); //性别
        tt.writeImageLocal(fileName, tt.modifyImage(d, "汉", 220, 95, 0)); //民族
        tt.writeImageLocal(fileName, tt.modifyImage(d, result.get("year") + "    " + result.get("month") + "    " + result.get("day"), 120, 135, 0)); //出生年月

        List<String> data = new ArrayList<String>();
        int iLen = address.length();
        while (iLen >= 20) {
            String tmp = address.substring(0, 20);
            data.add(tmp);
            address = address.substring(20);
            iLen = address.length();
        }
        for (int i = 0; i < data.size(); i++) {
            tt.writeImageLocal(fileName, tt.modifyImage(d, data.get(i), 95, 181 + 10 * i, 0)); //住址
        }
        tt.writeImageLocal(fileName, tt.modifyImage(d, result.get("idCardNo"), 180, 292, 10)); //身份证号
        System.out.println("身份证正面生成成功~！");
    }
}
